    value: All contributions received directly by MDP do show the full indentification
      of the donor including occupation and employer when the donations exceeds $200.00
      in a calendar year. The donors who are missing that information in our report
      are from the DNC Victory Fund and the Dollar for Democrats programs.The Maine
      Democratic Party participates with these groups in  joint fundraising. We do
      understand that they are our agents and we have requested and received from
      both entities the detailed description of their procedures for requesting the
      required information.  We are forwarding that information to under separate
      cover.  We do not have it in electronic form.  Regarding the issue of aggregate
      year-to-date totals
  - value: ' again'
  - value: ' we are dealing with the contributions from above entities.  Per a conversation
      bewteen Neil Reiff of Sandler and Reiff and Debbie Chacona'
  - value: ' it is our understanding that the FEC software does not support the aggregating
      process when memo entries are imported into the fecfile software. It is our
      further understanding that requests for this information were not to be sent.'
  expected_count: 4
  input: TEXT,F3XA,,"All contributions received directly by MDP do show the full indentification
    of the donor including occupation and employer when the donations exceeds $200.00
    in a calendar year. The donors who are missing that information in our report
    are from the DNC Victory Fund and the Dollar for Democrats programs.The Maine
    Democratic Party participates with these groups in  joint fundraising. We do understand
    that they are our agents and we have requested and received from both entities
    the detailed description of their procedures for requesting the required information.  We
    are forwarding that information to under separate cover.  We do not have it in
    electronic form.  Regarding the issue of aggregate year-to-date totals, again,
    we are dealing with the contributions from above entities.  Per a conversation
    bewteen Neil Reiff of Sandler and Reiff and Debbie Chacona, it is our understanding
    that the FEC software does not support the aggregating process when memo entries
    are imported into the fecfile software. It is our further understanding that requests
    for this information were not to be sent."
